import React from 'react';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import './MainPage';
import { Navigate } from 'react-router-dom';

const MainPage = () => {
    return (
        <div>
            <ArrowBackIcon className='arrow-icon' onclick={()=>{navigate('/')}} />
        </div>
    );
}

export default MainPage;
